import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
import imageFile from "./Images/vvv.png";
import Image from "react-bootstrap/Image";
import Row from "react-bootstrap/esm/Row";
import Col from "react-bootstrap/esm/Col";
import image1 from "./Images/image1.png";
import image3 from "./Images/image3.png";
import image4 from "./Images/image4.png";
import Arrow from "./Images/arrow.png";

import "./App.css";




import "./App.css";


const LearningComponent = () => {
  return (
    <div>
      <div className="learn">
        <Row className="container-fluid mt-5">
          <Col xs={12} md={7} lg={7}>
            <p>
              Manage Your waste and enable a clean and pollution free
              environment
            </p>
            <div className="learning">
              <Col xs={12} md={2} lg={2}>
                <p className="lt"> 01 </p>
                <p className="lt2"> Separate waste </p>
                <Image src={image4} className="img1" />
              </Col>
              <Col xs={12} md={2} lg={2}>
                <Image src={Arrow} className="img2" />
              </Col>

              <Col xs={12} md={2} lg={2}>
                <p className="lt"> 02 </p>
                <p className="lt2"> Schedule pickup </p>
                <Image src={image4} className="img1" />
              </Col>

              <Col xs={12} md={2} lg={2}>
                <Image src={Arrow} className="img2" />
              </Col>

              <Col xs={12} md={2} lg={2}>
                <p className="lt"> 03 </p>
                <p className="lt2"> Pick up </p>
                <Image src={image4} className="img1" />
              </Col>
            </div>
          </Col>

          <Col xs={12} md={5} lg={5}>
            <Card style={{ width: "35rem" }}>
              <Card.Img variant="top" src={imageFile} />
            </Card>
          </Col>
        </Row>
      </div>
    </div>
  );
};

export default LearningComponent;
